import React from "react";

// react-bootstrap components
import {
  Badge,
  Button,
  Card,
  Form,
  Navbar,
  Nav,
  Container,
  Row,
  Col
} from "react-bootstrap";
import SabhasadregistrationForm from "components/AssemlyForm/assembly";
function Sabhasadregistration() {
  return (
    <>
      <Container fluid>
        <Row>
          <Col md="8">
            <Card>
              <Card.Header>
                <Card.Title as="h4">Sabhasad Registration *</Card.Title>
              </Card.Header>
              <Card.Body>
              <SabhasadregistrationForm/>
              </Card.Body>
            </Card>
          </Col>

        </Row>
      </Container>
    </>
  );
}

export default Sabhasadregistration;
